<script setup>
import { nextTick, onMounted, ref } from 'vue'
import { useUserStore } from '@/store/user'
import { useNavigationStore } from '@/store/navigation'
import { storeToRefs } from 'pinia'

const navigation = useNavigationStore()

let text2
let text1
let interactive

const nextStep = () => {
    text2.classList.add('visible')
    text1.classList.remove('visible')
    interactive.classList.add('active')
    interactive.addEventListener('click', () => {
        navigation.stepForward()
    })
}

// eslint-disable-next-line no-undef
defineExpose({
  nextStep
})

const user = useUserStore()
const { userName } = storeToRefs(user)
const map = ref(false)



onMounted(async () => {
    await nextTick()

    text1 = document.querySelector('#text-1')
    text2 = document.querySelector('#text-2')
    interactive = document.querySelector('#interactive')

    setTimeout(() => {
        text1.classList.add('visible')
    }, 1500)

    setTimeout(() => {
        map.value = true
    }, 2500)
    
})
</script>

<style scoped lang="scss">
#interactive {
    display: none;

    &.active {
        display: block;
    }
}
</style>